import { Button, Container, Row, Col, Nav, Navbar } from 'react-bootstrap';

function MainPage() {
    return (
        <div>
            <header>
                <h3>X-search</h3>
            </header>
            <input type='text'></input>
            <Button>입력하기</Button>
        </div>
    )
}

export default MainPage;
